INSERT INTO `peinados` (`id`, `nombre`, `descripcion`, `foto`, `precio`) VALUES
(1, 'Fade (degradado)', 'Consiste en un corte de pelo para hombre con degradado en los costados de la cabeza. Es decir, en la parte de arriba se mantiene mucha cantidad de pelo y en los laterales este se reduce de forma progresiva. Con este corte de pelo para hombre se disimula e', , '8€');
INSERT INTO `peinados` (`id`, `nombre`, `descripcion`, `foto`, `precio`) VALUES
(2, 'Undercut', 'Este corte de pelo para hombre también consiste en dejar mayor cantidad de pelo en la parte superior de la cabeza y menos en los laterales. La diferencia con el corte de pelo “fade” es que en éste el corte de pelo de los laterales es más uniforme y suele ser más corto de longitud, aunque eso lo decides tú. Con este corte de pelo para hombre irás a la última. Además, si tienes el rostro cuadrado te sentará genial.', , '10€');
INSERT INTO `peinados` (`id`, `nombre`, `descripcion`, `foto`, `precio`) VALUES
(3, 'Buzz', 'Tal vez con el nombre inglés “buzz” no te suene pero si te decimos muy corto o casi rapado, seguro que ya sabes de qué tipo de corte de pelo para hombre te estamos hablando. Si eres de los que no te gusta dedicar mucho tiempo a tu peinado este es tu look. Consiste en un rapado de toda la cabeza que deja poca cantidad de pelo destacando las facciones del hombre. Conseguirás estar a la moda este año e ir siempre perfecto.', , '5€');
INSERT INTO `peinados` (`id`, `nombre`, `descripcion`, `foto`, `precio`) VALUES
(4, 'Hipster', 'El estilo hipster está de moda, así que con un peinado hipster seguro que aciertas. Este tipo de corte de pelo para hombre se caracteriza por su volumen en la parte central y los laterales cortos. Puedes peinarlo hacia atrás o hacia el lado. ¡Conseguirás un estilo muy interesante y elegante! Ser hipster es un estilo de vida y, con él, asumes sus cortes de pelo. De entre las múltiples posibilidades que podríamos encajar dentro de este estilo destacamos dos tendencias dentro del afamado corte de p', , '14€');
INSERT INTO `peinados` (`id`, `nombre`, `descripcion`, `foto`, `precio`) VALUES
(5, 'Raya al lado', 'Este año el corte de pelo con raya al lado seguirá de moda. Son muchos los famosos y no tan famosos que lo llevan. Así que, consigue este pelo y estarás elegante y a la última. Obtendrás un look top con la raya al lado derecho y peinado, aunque puedes probar el lado que más te favorezca. ¡Tú decides! La raya al lado de toda la vida, muy marcada y normalmente a la derecha. Favorecedor para casi todos los rostros, es un corte de pelo muy versátil, ya que se adapta bien al cabello liso o rizado y, ', , '7€');
INSERT INTO `peinados` (`id`, `nombre`, `descripcion`, `foto`, `precio`) VALUES
(6, 'Tupé Moderno', 'Este estilo de llevar el cabello muy corto por los lados, tal y como ves en las imágenes de arriba, no es nuevo si tenemos en cuenta que ya durante el Primavera Verano , se llevaba mucho pero sí que ha acabado imponiéndose este año y aporta mucha frescura al estilo de cabello masculino.', , '12€');
INSERT INTO `peinados` (`id`, `nombre`, `descripcion`, `foto`, `precio`) VALUES
(7, 'TUPÉ RIZADO', 'Para los que tengáis el cabello rizado, podéis llevar entonces el cabello visto anteriormente de la tendencia del tupé. Como en la imagen de arriba, tenemos un estilo en cabello corto ideal para aquellos caballeros que tengan el pelo un tanto ondulado o con ondas.', , '15€');

